import React from "react";



import Products from "./pages/shop.component";
import "./App.scss";

import SideBar from "./components/common/sideBar/sideBar";

class App extends React.Component {
  render() {
    return (
      <div id="app">
        <SideBar pageWrapId={"page-wrap"} outerContainerId={"App"} />
        <Products />
      </div>
    );
  }
}

export default App;
